import React from 'react'
import arrow from '../Img/TransparateButton/arrow.png'

export const TransparateButton = ({text}) => {
  return (
    <button className='transparate-button'>
        <p className='transparate-button-text'>{text}</p>
        <img src={arrow}/>
    </button>
  )
}
